import React, { useState, useEffect } from 'react';
import UserTable from "../components/UserTable";

function View2() {
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch("/view2").then(
            res => res.json()
        ).then(
            data => {
                setData(data)
            }
        )
    }, [])

    return (
        <div>
            <h1>This is the View 2 page</h1>
            <h3>These are the users that have been entered:</h3>
            <table>
            <thead>
                <tr>
                    <th>ID</th>
                    <th>Name</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td>
                        {
                            Object.keys(data).map((key, index) => (
                                <p key={index}>{key}</p>
                            ))
                        }
                    </td>
                    <td>
                        {
                            Object.keys(data).map((key, index) => (
                                <p key={index}>{data[key]}</p>
                            ))
                        }
                    </td>
                </tr>
            </tbody>
        </table>
        </div>
    )
}

export default View2;
